import React from "react";
import Dropdown from 'react-dropdown';
import 'react-dropdown/style.css';

const dropDown = () => {
    const options = [
        'one', 'two', 'three'
      ];
      const defaultOption = options[0];
    return (
        <Dropdown options={options} onChange={this._onSelect.options} value={defaultOption} placeholder="Select an option" />   
    );
  }
  export default dropDown;
